script: |
  super -f text -I q730.spq | sort > q730.out

inputs:
  - name: q730.spq
    data: |
      SELECT - - col2 AS col2 FROM tab0 (FORMAT parquet) WHERE NOT - + ( col1 ) IN ( col1 * - + 99 + + col1, + 70 / 67, col1 * - col2, + - col2 + + col1 - + + col1, - col0, col2 + + + 94, - + 28 );
  - name: tab0

outputs:
  - name: q730.out
    data: |
      10
      47
      99
